def process_card_queries(n, q, a, queries):
    """"""
    mindex = [1 << 128] * 100
    seen = [False] * 100
    stack = []
    for (i, v) in enumerate(a):
        if not seen[v]:
            seen[v] = True
            stack.append((v, i))
    results = []
    for query in queries:
        for (i, elem) in enumerate(stack):
            if elem[0] == query:
                results.append(elem[1] + 1)
                for j in range(i - 1, -1, -1):
                    (vp, ip) = stack[j]
                    (vq, iq) = stack[j + 1]
                    stack[j + 1] = (vp, ip + 1)
                stack[0] = (query, 0)
                break
    return results
